import styles from "../styles/interestStyles";
import { withStyles } from "@material-ui/styles";

const interests = ({ classes }) => {
  return (
    <div className={classes.interests}>
      <h1 style={{ fontFamily: "Oswald" }}>INTERESTS</h1>

      <h4 className={classes.h4}>
        Web developing! Apart from that, I enjoy the great outdoors whether it
        be mountain biking, rock climbing, skiing, backpacking, hiking, or just
        taking a step back to appreciate it all.
      </h4>
      <h4 className={classes.h4}>
        Not only do I love building with code, I also like building with my
        hands. My wife and I converted a cargo van into a campervan that we have
        been traveling in for over a year. The environment is something I am
        expecially passionate about, Earth is the only home we have, lets find
        ways to better her.
      </h4>
      <h5 style={{ fontWeight: "lighter", color: "gray" }}>
        "The solution often turns out more beautiful than the puzzle." - Richard
        Dawkins
      </h5>
    </div>
  );
};

export default withStyles(styles)(interests);
